@lucian [τ, נ] SN41  the temp solution is, find a key that works. We don't know the upper limits of how many people can use them before they break. 

If anyone has a working key that they're willing to donate to the cause, please PM me and we will try to work with these until we have a better answer. 

Unfortunately to get feedback from Wandb has been difficult, though it is ongoing. We are building a completely new solution from the ground up, but things like that take time.
